import React, { Component } from 'react';
import '../css/Nav.css';
class Nav extends Component {
  render() {
    return (
      <div>
        <header>
          <div>
            <h1 className="logo">Welcome to Mackenson Dorancy Profolio</h1>
            <ul>
              <li>Home</li>
              <li>About</li>
              <li>Projects</li>
            </ul>
          </div>
        </header>
      </div>
    );
  }
}

export default Nav;
